let canvas = document.getElementById('header-logo')
let heightRatio = 1.5
canvas.height = canvas.width * heightRatio
let context = canvas.getContext('2d')
let particles = []

function drawLogo() {
  canvas.width = png.width * 5
  canvas.height = png.height * 5

  context.drawImage(png, 0, 0)

  let data = context.getImageData(0, 0, png.width, png.height)
  context.clearRect(0, 0, canvas.width, canvas.height)

  for (let y = 0; y < data.width; y++) {
    for (let x = 0; x < data.height; x++) {
      let pixel = (x + y * data.width) * 4
      if (data.data[pixel + 3] > 128) {
        let particle = {
          x0: x,
          y0: y,
          x1: png.width / 2,
          y1: png.height / 2,
          speed: Math.random() * 4 + 2
        }

        TweenMax.to(particle, particle.speed, {
          x1: particle.x0,
          y1: particle.y0,
          delay: y / 30,
          ease: Elastic.easeOut
        })
        particles.push(particle)
      }
    }
  }
  requestAnimationFrame(render)
}

let render = () => {
  context.clearRect(0, 0, canvas.width, canvas.height)
  for (let i = 0; i < particles.length; i++) {
    context.fillStyle = '#EA484E'
    context.fillRect(particles[i].x1 * 5, particles[i].y1 * 5, 2, 2)
  }
  requestAnimationFrame(render)
}

let png = new Image()
png.onload = drawLogo
png.src =
'data:image/png;base64,'
